import React from "react";
import s from "./gallery.module.css";


const Gallery = () => {
  const defaultIages = [
      {
          img: "1.jpg",
          text: "first"
      },
      {
          img: "2.jpg",
          text: "second"
      }
  ]

  return (
      <div className={s.galery_main}>
          {defaultIages.map((imgObj) => {
              const {img} = imgObj;
              return (
                  <img src={img}/>
              )
          })}

      </div>
  )
        }
export default Gallery
